import React from 'react';

const NavigationSideMenu = () => {
  return (
    <div className="bg-blue-900 h-screen p-6">
      <div className="text-white">
        <div className="mb-4">Company Name</div>
        <div className="flex flex-col gap-2">
          <button className="bg-purple-600 text-white rounded py-2 px-4">Home</button>
          <button className="text-gray-300 rounded py-2 px-4">History</button>
        </div>
      </div>
    </div>
  );
};

const Modal = () => {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
      <div className="bg-blue-800 text-white p-6 rounded-lg">
        <h1 className="text-xl mb-4">Welcome to "Your Brand Name"</h1>
        <p className="mb-4">Finding your perfect card is just a click away.</p>
        <button className="bg-purple-600 text-white rounded py-2 px-4">Create your Card</button>
      </div>
    </div>
  );
};

const Dashboard = () => {
  return (
    <div className="flex">
      <NavigationSideMenu />
      <div className="flex-grow">
        {/* Content */}
        <Modal />
      </div>
    </div>
  );
};

export default Dashboard;
